import './style.scss';
import React, { Component } from 'react';
import faker from 'faker';

class Footer extends Component {
  render(){
    return(
      <footer>
        <div> Footer component</div>
        <a className="avatar">
         <image alt="avatar" src={faker.image.avatar()} />
        </a>
      </footer>
    )
  }
}

export default Footer;
